// ==UserScript==
// @name         Jekka for Tiktok (Part1)
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  Jekka is a leading AI chatbot worldwide. This script enables Jekka to assist you in responding to TikTok customer service messages, helping you efficiently manage customer demands and boost sales for your store. To use this script, you will need to integrate it with the Jekka chatbot management platform. For detailed instructions, please contact support@jekka.ai.
// @author       Jekka.ai
// @match        https://seller.tiktokglobalshop.com/chat/inbox/*
// @run-at       document-start
// @icon         data:image/x-icon;base64,
// @grant        GM_xmlhttpRequest
// @grant        unsafeWindow
// @downloadURL https://update.greasyfork.org/scripts/488420/Jekka%20for%20Tiktok%20%28Part1%29.user.js
// @updateURL https://update.greasyfork.org/scripts/488420/Jekka%20for%20Tiktok%20%28Part1%29.meta.js
// ==/UserScript==
(function () {
    'use strict';

    function callApi(body, callback) {
        GM_xmlhttpRequest({
            method: "POST",
            url: 'https://apidev.jekka.ai/api/v1/chat/tt/message',
            headers: {
                "Content-Type": "application/json"
            },
            data: JSON.stringify(body),
            onload: function (response) {
                if (response.status >= 200 && response.status < 300) {
                    callback(null, JSON.parse(response.responseText));
                } else {
                    callback(new Error("API调用失败: " + response.statusText), null);
                }
            },
            onerror: function (error) {
                callback(new Error("API调用失败"), null);
            }
        });
    }

    document.addEventListener('DOMContentLoaded', function () {
        unsafeWindow.addEventListener('message', function (event) {
            // console.log('Received message from Script 1:', event.data);
            console.log(event.data)
            var p_data = JSON.parse(event.data);
            callApi(p_data, function (error, data) {
                if (error) {
                    console.error("API调用失败", error);
                } else {
                    console.log("API调用成功", data);
                    console.log(p_data['conversation_id']);
                    console.log(data['data'])
                    // 在这里处理API返回的数据
                    unsafeWindow.mysend(p_data['conversation_id'], {
                        "content": data['data'],
                        "ext": {"type": "text", "original_content": data['data'], "detect_lang": ""}
                    });
                }
            });
        });
        const button = document.createElement('button');
        button.innerText = '配置';
        button.style.position = 'fixed';
        button.style.top = '10px';
        button.style.right = '10px';
        button.style.zIndex = '9999';
        document.body.appendChild(button);

        button.addEventListener('click', function () {
            var test_datas = {
                'text': '测试',
            }
            callApi(test_datas, function (error, data) {
                if (error) {
                    console.error("API调用失败", error);
                } else {
                    console.log("API调用成功", data);
                    // 在这里处理API返回的数据
                }
            });
        });
    });


})();

